import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import Header from './Components/Header';
import Signup from './Components/Signup';
import Login from './Components/Login';
import Navbar from './Components/Navbar';
import { useAuthContext } from './hooks/useAuthContext'
import OwnerLogin from './Components/Owner/OwnerLogin';
import OwnerSignup from './Components/Owner/OwnerSignup';
import OwnerHome from './Components/Owner/OwnerHome';
//import { OwnerSignup } from './Components/Owner/';
import Home from './Components/Home';


function App() {
const { user }  = useAuthContext();

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/' element={!user ? <Header /> : <Navigate to={'/'}/>}></Route>
        <Route path='/Login' element={!user ?  <Login /> : <Navigate to={'/'} />}></Route>
        <Route path='/Signup' element={!user ? <Signup /> : <Navigate to={'/'}/>}></Route>
        <Route path='/OwnerLogin' element={!user ? <OwnerLogin /> : <Navigate to={'/'}/>}></Route>
        <Route path='/OwnerSignup' element={!user ? <OwnerSignup /> : <Navigate to={'/'} />}></Route>
        <Route path='/OwnerHome' element={user.type=="user" ? <Home /> : <Navigate to={'/'}/>}></Route>
        <Route path='/OwnerHome' element={user.type=="owner" ? <OwnerHome /> : <Navigate to={'/'}/>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
